INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES ("カリン", "受け取ることができる\n報酬があるようです\n確認してみてください", 2.801, 1, 190801, 2, "2030/01/01 14:59:59", 1, 1000003, 63, -416.5, 3, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES ("カリン", "報酬がもらえますよ！\nチェックしてみてください", 0.0, 2, 190801, 2, "2030/01/01 14:59:59", 1, 1000004, 63, -416.5, 4, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES ("カリン", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 2.12, 2, 190801, 1, "2030/01/01 14:59:59", 1, 1000005, 64, -363.0, 5, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES ("カリン", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1.68, 1, 190801, 2, "2030/01/01 14:59:59", 1, 1000006, 64, -363.0, 6, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES ("カリン", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 2.33, 2, 190801, 1, "2030/01/01 14:59:59", 1, 1000007, 64, -363.0, 7, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES ("ラビリスタ", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 5.18, 3, 133701, 7, "2030/01/01 14:59:59", 10201, 1020101, 61, -285.0, 101, -6.0, "2025/01/31 12:00:00");
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES ("クリスティーナ", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 8.77, 1, 133901, 2, "2030/01/01 14:59:59", 10201, 1020102, 61, -285.0, 201, -2.0, "2025/01/31 12:00:00");
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES ("ネネカ", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 15.5, 6, 133801, 1, "2030/01/01 14:59:59", 10201, 1020103, 61, -285.0, 301, 0.0, "2025/01/31 12:00:00");
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES ("ランファ", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 9.061, 2, 134301, 5, "2030/01/01 14:59:59", 10202, 1020201, 61, -285.0, 101, 0.0, "2025/02/28 12:00:00");
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES ("チカ", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 7.699, 1, 134401, 2, "2030/01/01 14:59:59", 10202, 1020202, 61, -285.0, 201, 0.0, "2025/02/28 12:00:00");
